Interested in learning genuine martial arts, or getting in shape during the summer? Consider signing up for the Martial Arts Summer Training Camp at the Johnston Karate Dojo, located at 118 Sauls St. in Lake City, SC! This torrent includes news and information about our camps, as well as pictures and other Lake City, SC news. Both men and women are accepted. The core martial arts drilled will be Boxing, Karate, and muay Thai. We also want to focus on MMA, self defense, and fitness. We will be charging affordable tuition prices during our martial arts training camp. Qualified volunteers may train for free during our camp.
